import React from "react";
import { Link } from "react-router-dom";

const DUMMY = [
  { id: "dum1", title: "Dummy 1" },
  { id: "dum2", title: "Dummy 2" },
  { id: "dum3", title: "Dummy 3" },
];

const EventsPage = () => {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {DUMMY.map((some) => (
          <li key={some.id} >
            <Link>{some.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};

export default EventsPage;
